import React from 'react';
import Logo from './commons/Logo';
import HeaderUser from './HeaderUser';

function Header(porps) {
  return (
    <div className='header'>
      <div className='container'>
        <div>
          {porps.showMenu && 'ss'}
          <Logo />
        </div>
        <HeaderUser image='' name='Name' />
      </div>
    </div>
  );
}

export default Header;
